import React from 'react';
import Content from '../Components/Content';
import Hero from '../Components/Hero';
import icoPython from '../Assets/icons/python.svg'
import Bar from '../Components/Bar';

const languages = [
    {
        icon: icoPython,
        name: 'Python',
        level: ''
    },
    {
        icon: icoPython,
        name: 'C++',
        level: ''
    },
    {
        icon: icoPython,
        name: 'C',
        level: ''
    },
    {
        icon: icoPython,
        name: 'Java',
        level: ''
    },
    {
        icon: icoPython,
        name: 'mySQL',
        level: ''
    }
]


const tools =[
    {
        icon: icoPython,
        name: 'Python',
        level: ''
    },
    {
        icon: icoPython,
        name: 'C++',
        level: ''
    },
    {
        icon: icoPython,
        name: 'C',
        level: ''
    },
    {
        icon: icoPython,
        name: 'Java',
        level: ''
    },
    {
        icon: icoPython,
        name: 'mySQL',
        level: ''
    }
]


function AboutPage(props) {
    
    return(
        <div >
            <Hero title={props.title} />
            <div className="resume container">
                <div className="row">
                    <div className="col-lg-6 resume-card">
                        <h4 className="resume-card__heading">
                            Education 
                        </h4>
                        <div className="resume-card__body">
                            <h5 className="resume-card__title">
                                Computer Science
                            </h5>
                            <p className="resume-card__name">
                                University of Illinois at Chicago
                            </p>
                            <p className="resume-card__details"> School description</p>
                        </div>
                    </div>
                    <div className="col-lg-6 resume-card">
                        <h4 className="resume-card__heading">
                            Experience 
                        </h4>
                        <div className="resume-card__body">
                            <h5 className="resume-card__title">
                                Harper College
                            </h5>
                            <p className="resume-card__name">
                                Intern
                            </p>
                            <p className="resume-card__details"> School description</p>
                        </div>
                                                <div className="resume-card__body">
                            <h5 className="resume-card__title">
                                Harper College
                            </h5>
                            <p className="resume-card__name">
                                Intern
                            </p>
                            <p className="resume-card__details"> School description</p>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col-lg-6 resume-languages">
                        <h5 className="resume-language__heading">
                            Languages
                        </h5>
                        <div className="resume-language__body">
                            {
                                languages.map(language => 
                                    <Bar value={language}/>
                                    )
                            }
                        </div>
                    </div>
                    <div className="col-lg-6 resume-languages">
                        <h5 className="resume-language__heading">
                            Tools and Software
                        </h5>
                        <div className="resume-language__body">
                            {
                                
                            }
                        </div>
                    </div>
                </div>
            </div> 
        </div>
        // <div>
        //     <Hero title={props.title} />

        //     <Content>
        //         <p> Work on it soon with HTML and CSS</p>
        //     </Content>
        // </div>
    );
}

export default AboutPage;
